import React, { Component } from 'react';

class TripCard extends Component {
  render() {
    return (
      <div>
        <h1>{this.props.trip.location}</h1>
        <p>Insert Image Here</p>
      <h3>Notes</h3>
      {this.props.trip.notes.map(note => {
        <li>{note}</li>
      })}
      </div>
    )
  }
}

export default TripCard;
